[{"Mã phim":"PT1","Tên phim":"Siêu trộm đường phố","Thể loại":"Hành động","Quốc gia sản xuất":"Mỹ","Đạo diễn":"Charles Dickens.","Khởi chiếu":"12/03/2021","Thời lượng":"90","Các diễn viên tham gia":"Raff Law, Michael Caine, Lena Headey, Franz Drameh, Sophie Simnett","Nội dung chính":"Lấy bối cảnh tại Vương quốc Anh, Siêu Trộm Đường Phố xoay quanh một phi vụ đánh cắp thế kỷ. Bộ phim theo chân anh chàng Oliver Twist – được biết đến là một nghệ sĩ graffiti chuyên nghiệp (nghệ sĩ biểu diễn nghệ thuật đường phố) tại thành phố London. Trong một cuộc chạm trán bất ngờ với Dodge, anh vô tình bị cuốn vào băng đảng của cô ấy và sa vào đường dây tội phạm. Băng đảng bao gồm các thành viên: Dodge, Red, Batesey, thành viên mới Oliver Twist và “ông trùm” Fagin. ","Hình ảnh":""}]